import { Redirect, Route, Switch } from "react-router-dom";
import AllQuouts from "./pages/AllQuouts";
import NewQuout from "./pages/NewQuout";
import QuoutDetail from "./pages/QuoutDetail";

function App() {
  return (
    <div>
        <Switch>
            <Route path='/' exact>
              <Redirect to='/allQuouts'/>
            </Route>
            <Route path='/allQuouts' exact>
                <AllQuouts/>
            </Route>
            <Route path='/allQuouts/:quoutId' >
                <QuoutDetail/>
            </Route>
            <Route path='/addQuouts' >
                <NewQuout/>
            </Route>
        </Switch>
    </div>
  );
}

export default App;
